import React from "react";

const Movies = (props) => {
  const { data, count } = props;

  return (
    <div>
      <ul>
        <p>{count}</p>
        {data.map((movie) => {
          return (
            <li className="movie" key={movie.id}>
              <img src={movie.poster_path} alt={movie.title}>
                <a>{movie.title}</a>
              </img>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Movies;
